import React from 'react'
import SyntaxHighlighter from "react-syntax-highlighter";
import "./Highlighter.css";
const Highlighter = ({ language, theme, children }) => {
    return (
        <SyntaxHighlighter
            language={language}
            style={theme}
            className="highlighter"
        >
            {children}
        </SyntaxHighlighter>
    );
}

export default Highlighter
